window.bookSummaryJSON = "<p><b>A marriage forged in battle.</b></p> <p>Alexei Dvorkin has come a long way since being turned into a metahuman, and all he wants to do is marry the man he loves. A wedding is easy, but it’s the honeymoon where his and Sean’s past unexpectedly catches up with them. </p> <p>All Sean Delaney wanted was a romantic honeymoon with his new husband. When he and Alexei stumble into a fellow operative’s mission on a luxury gambling resort island, they get more than they bargained for in their newly-minted civilian lives. </p> <p>Forced to choose between staying and joining the mission or leaving to stay safe and postpone their honeymoon, Alexei and Sean make the only decision they can—to fight.</p>"; 
